import React from 'react';

const NutritionPage = () => {
    return (
        <div className="min-h-screen bg-black text-white p-2 pb-16">
            <div className="max-w-sm mx-auto">
                <h1 className="text-xl font-bold text-yellow-500 mb-4">Nutrición</h1>
                <div className="bg-gray-900 rounded-xl p-4">
                    <p className="text-gray-300">Próximamente: Planes de nutrición personalizados</p>
                </div>
            </div>
        </div>
    );
};

export default NutritionPage;
